Vorbemerkung: Der Eintritt in den Beruf des Asphaltierers setzt an allgemeinen
Eignungsanforderungen voraus:
Arbeitswille, Gewissenhaftigkeit und Verantwortungsbewußtsein;
Verträglichkeit;
Allgemeinbegabung;
Handgeschicklichkeit und
Selbständigkeit.
Im folgenden sind darüber hinaus die besonderen Anforderungen aufgeführt.

Formsinn;
Formauffassung;
Formvergleich
